import logo from './logo.svg';
import './App.css';

function App() {
    return (

        <div className="container">

                        <form action="/login" method="post">


                                <p>
                                    <span className="fa fa-user"></span>
                                    <input type="text" name="username" Placeholder="e-mail" required></input></p>
                                <p><span className="fa fa-lock"></span>
                                    <input type="password" name="password" Placeholder="password" required></input>
                                </p>

                                <div>
                                <span style="width:48%; text-align:left;  display: inline-block;"><a
                                    className="small-text"
                                    href="#">Forgot password?
                                </a></span>
                                    <span style="width:50%; text-align:right;  display: inline-block;"><input
                                        type="submit"
                                        value="Log in"></input></span>
                                </div>

                        </form>

        </div>
);
}

export default App;
